import { Row, Col } from 'react-bootstrap';
import Slider from 'react-slick';

function TestimonialSlider(props) {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <div className="Testimonial-Slider">
      <Slider {...settings}>
        <div>
          <Row>
            <Col md={6}>
              <div className="Testimonial-Slider__InnerBox">

              </div>
            </Col>
            <Col md={6}>

            </Col>
          </Row>
        </div>
      </Slider>
    </div>
  );
}

export default TestimonialSlider;
